<br />
W lipcu 2015 roku praca operacyjna gorzowskich policjantów dała początek sprawie, która doprowadziła do oskarżenia dwóch osób. Funkcjonariusze z Wydziału do Walki z Przestępczością Narkotykową Komendy Miejskiej Policji w Gorzowie Wlkp. pracowali pod nadzorem gorzowskiej Prokuratury Okręgowej. Na terenie województwa wielkopolskiego, na jednej z posesji 23 lipca 2015 roku policjanci zlikwidowali laboratorium oraz zabezpieczyli znaczne ilości substancji, które mogły służy do produkcji tzw. dopalaczy. Działania śledczych trwały kilka dni. Do sprawy policjanci zatrzymali kilkaset litrów różnego rodzaju odczynników i roztworów, co najmniej 100 kilogramów półproduktów, a także ponad 1000 sproszkowanych działek dilerskich, które przygotowane były do sprzedaży. Policjanci ujawnili także 60 gramów marihuany.<br />
<br />
W pomieszczeniach gospodarczych funkcjonowało swego rodzaju laboratorium. Policjanci zabezpieczyli sprzęt i urządzenia, które mogły służyć do masowej produkcji niebezpiecznych produktów. Kilka miesięcy trwało badanie i identyfikacja zabezpieczonych substancji. Kilkukrotnie powołano biegłych z dziedziny fizykochemii, którzy podczas badań zabezpieczonych substancji stwierdzili obecność niebezpiecznych dla życia i zdrowia człowieka związków chemicznych. Wiele z nich ma bardzo silne oddziaływanie na ośrodkowy układ nerwowy. Wśród nich są substancje, które zostały wycofane ze sprzedaży na terenie Polski już kilka lat temu. Kolejne to związki wywołujące silne działanie w układzie nerwowym i wpływające na procesy myślowe czy koncentrację. Z opinii biegłych wynika również, że zażycie substancji mogło powodować bóle głowy, drżenie rąk, rozdrażnienie, a w konsekwencji upośledzenie ważnych dla zdrowia i życia układów i narządów. Zabezpieczone w trakcie przeszukania substancje to środki, które nie są standardowymi środkami zastępczymi (dopalaczami). Nie ulega jednak wątpliwości, że ich zażywanie prowadzi do efektów niekorzystnych dla zdrowia i życia ludzkiego.<br />
<br />
Prokurator Okręgowy w Gorzowie Wlkp. w akcie oskarżenia zwraca także uwagę na warunki przechowywania substancji oraz prowadzenie działalności w innym miejscu niż wskazane i znacznie wykraczającej poza zakres wydany w zezwoleniu. Te obejmowało zgodę między innymi na sprzedaż wysyłkową wyciągów roślinnych, dodatków do żywności czy suplementów diety. Laboratorium umieszczone w pomieszczeniach gospodarczych nie było w żaden sposób nadzorowane pod kątem sanitarno-higienicznym. Substancje wykorzystywane do produkcji środków spożywczych były przeterminowane. Pomieszczenie nie spełniało warunków do dokonywania tam procesów chemicznych. Zgromadzone substancje i sposób ich przechowywania stwarzały zagrożenie dla zdrowia i życia ludzi.<br />
<br />
33-latek z Wielkopolski oraz 32-latek z województwa warmińsko-mazurskiego odpowiedzą za sprowadzenie bezpośredniego niebezpieczeństwa dla życia i zdrowia wielu osób poprzez m.in. wprowadzenie do obrotu szkodliwych dla zdrowia środków zastępczych. Kolejny zarzut dotyczy sprowadzenia niebezpieczeństwa dla zatrudnionych pracowników, mieszkańców domu oraz budynków sąsiadujących poprzez m.in. gromadzenie substancji łatwopalnych i silnie toksycznych. Mężczyźni odpowiedzą także za złamanie przepisów ustawy o bezpieczeństwie żywności i żywienia - prowadzenie sprzedaży żywności na odległość bez wpisu do rejestru. Kolejny zarzut dotyczy sprzedaży przez internet szkodliwych dla zdrowia i życia człowieka środków spożywczych oraz suplementów diety. 33-latek odpowie również za posiadanie 60 gramów marihuany. Obaj podejrzani przyznali się do zarzucanych im czynów.', '2017-02-10 10:01:00+01', 9, '2017-02-10 12:28:17.46+01', false, true, '2017-02-10 17:40:33.517+01');
 
