INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/sport/a/umorzone-sledztwo-ws-wypadku-krystiana-rempaly-smierc-zuzlowca-przez-odpiety-kask,11723558/', 'Umorzone śledztwo ws. wypadku Krystiana Rempały! Śmierć żużlowca przez odpięty kask', 'Potwierdziły się nasze ubiegłotygodniowe informacje. Prokuratura w Rybniku umorzyła śledztwo w sprawie wypadku ze skutkiem śmiertelnym Krystiana Rempały na torze w Rybniku. Według prokuratury, Krystian Rempała w chwili wypadku nie miał zapiętego kasku. - To jakaś parodia - kwituje ojciec zmarłego żużlowca.', '2017-02-01 11:56:00+01', 8, '2017-02-01 18:05:55.536+01', false, true, '2017-02-02 21:29:49.579+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/strefa-biznesu/wiadomosci/a/to-juz-pewne-od-najblizszych-wakacji-za-rozmowy-i-smsy-zza-granicy-nie-dolicza-nam-roamingu,11749860/', 'To już pewne: od najbliższych wakacji za rozmowy i sms-y zza granicy nie doliczą nam roamingu', 'Już w czerwcu z cenników operatorów komórkowych ma zniknąć opłata za roaming czyli za rozmowy telefoniczne oraz sms-y wysyłane z jednego kraju do drugiego. To efekt porozumienia Parlamentu Europejskiego z krajami członkowskimi, które zostało zawarte 1 lutego br.', '2017-02-01 11:50:00+01', 8, '2017-02-01 18:05:55.537+01', true, false, '2017-02-02 21:29:55.149+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/aktualnosci/a/otwarcie-zlobka-w-czarnem-z-macierewiczem-w-tle,11749596/', 'Otwarcie żłobka w Czarnem z Macierewiczem w tle ', 'Nawet jeśli minister obrony narodowej nie będzie ministrem, jego imię będzie upamiętniała tablica w czarneńskim żłobku. Na otwarciu placówki odsłonięto pamiątkową tablicę.', '2017-02-01 10:10:00+01', 8, '2017-02-01 18:05:55.538+01', false, true, '2017-02-02 21:29:58.044+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/afera-reprywatyzacyjna-w-warszawie-sa-wnioski-o-areszt-tymczasowy-dla-oskarzonych,11749598/', 'Afera reprywatyzacyjna w Warszawie: Są wnioski o areszt tymczasowy dla oskarżonych ', 'Do sądu rejonowego we Wrocławiu wpłynęły wnioski o tymczasowy areszt dla Aliny D., Jakub R., Roberta N., i Wojciecha R., oskarżonych w związku z warszawską aferą reprywatyzacyjną. Wobec Mariusza L. zastosowano dozór policyjny, zakaz kontaktowania się z podejrzanymi oraz zakaz opuszczania kraju i poręczenie majątkowe w wysokości pół miliona złotych.', '2017-02-01 10:05:00+01', 8, '2017-02-01 18:05:55.539+01', true, false, '2017-02-02 21:30:02.031+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/brutalnie-gwalcil-nastolatki-policja-zatrzymala-mariana-d-z-grudziadza,11749428/', 'Brutalnie gwałcił nastolatki. Policja zatrzymała Mariana D. z Grudziądza!', 'Marian D. od listopada ukrywa się przed wymiarem sprawiedliwości. Sąd Rejonowy w Grudziądzu wydał za nim list gończy. Policja zatrzymała go dzisiaj na terenie Wielkiej Brytanii.', '2017-02-01 08:58:00+01', 8, '2017-02-01 18:05:55.54+01', false, true, '2017-02-02 21:30:05.355+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/a/marine-le-pen-ukarana-za-wydawanie-funduszy-unijnych-niezgodnie-z-prawem-to-polityczna-wendeta,11749410/', 'Marine Le Pen ukarana za wydawanie funduszy unijnych niezgodnie z prawem. "To polityczna wendeta" ', 'Kandydatka na prezydenta Francji Marine Le Pen ma kłopoty. O północy upłynął termin, w którym liderka Frontu Narodowego mogła oddać 300 tys. euro Parlamentowi Europejskiego. Le Pen płaciła bowiem swoim współpracowników z dotacji PE, co było niezgodne z prawem. Polityk twierdzi, że to wymierzona w nią &#34;polityczna wendeta&#34;.', '2017-02-01 08:41:00+01', 8, '2017-02-01 18:05:55.54+01', true, false, '2017-02-02 21:30:10.879+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/a/abw-sprawdza-czy-banki-zerowaly-na-frankowiczach,11747351/', 'ABW sprawdza, czy banki żerowały na frankowiczach', 'ABW przesłuchuje klientów banków, którzy zaciągnęli kredyty głównie we franku szwajcarskim. Przesłuchania odbywają się m.in. w Poznaniu. To efekt śledztwa nadzorowanego przez Prokuraturę Regionalną w Szczecinie. Sprawdza czy banki oszukały klientów podpisując z nimi umowy na kredyty. W umowach przypisały sobie m.in. możliwość swobodnego ustalenia ceny kursów obcych walut.', '2017-02-01 07:50:00+01', 8, '2017-02-01 18:05:55.541+01', true, false, '2017-02-02 21:30:16.902+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/tunezyjczyk-podpalil-jej-auto-bo-rzadziej-widywal-dziecko-prokuratura-bada-watek-religijny,11749134/', 'Tunezyjczyk podpalił jej auto, bo rzadziej widywał dziecko? Prokuratura bada wątek religijny', 'Trzy razy w zeszłym roku płonęły samochody mieszkanki Radlina. Oskarża byłego męża, Tunezyjczyka. Czy potwierdza się wątek, że podpalenie miało związek z różnicami religijnymi? – Potwierdzam, że w którymś piśmie poszkodowanej wątek religijny się pojawia – dodaje prokurator Felsztyński.', '2017-02-01 07:08:00+01', 8, '2017-02-01 18:05:55.542+01', false, true, '2017-02-02 21:30:26.244+01');
