INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/gmina-skaryszew-usilowanie-zabojstwa-noworodka-szokujace-okolicznosci-porodu,11750532/', 'Gmina Skaryszew. Usiłowanie zabójstwa noworodka. Szokujące okoliczności porodu', '- Karetka pogotowia przyjechała, gdy córka miała bóle. Ratownik spytał ją czy jest w ciąży? Ona odpowiedziała, że nie. Zostawili gruszkę do lewatywy i odjechali - opowiada dziadek noworodka, mąż babci dziecka aresztowanej na trzy miesiące, której prokuratura postawiła zarzut usiłowania zabójstwa wnuczki. On sam i jego syn mają zarzut nieudzielenia pomocy noworodkowi. Dziecko przeżyło dzięki przytomności ratowników medycznych.', '2017-02-01 16:16:00+01', 9, '2017-02-01 18:07:11.298+01', false, true, '2017-02-02 21:35:34.711+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/grypa-szaleje-na-slasku-4-osoby-zmarly-na-grype-w-styczniu-w-wojewodztwie-slaskim,11750262/', 'Grypa szaleje na Śląsku: 4 osoby zmarły na grypę w styczniu w województwie śląskim!', 'Grypa szaleje na Śląsku i woj śląskim. W styczniu zachorowało prawie 30 tys. ludzi. Cztery osoby zmarły. Nie było dla nich ratunku. Na razie nie wiadomo, czy grypa już się kończy, czy dopiero najgorsze przed nami. Więcej będzie wiadomo po pierwszym tygodniu lutego, gdy rozpoczęły się lekcje w szkołach po feriach. W szkołach bowiem i innych dużych skupiskach grypa rozprzestrzenia się najszybciej.', '2017-02-01 15:15:00+01', 9, '2017-02-01 18:07:11.303+01', false, true, '2017-02-02 21:35:35.838+01');
