INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/w-lubinie-znaleziono-zwloki-to-bylo-zabojstwo,11750194/', 'W Lubinie znaleziono zwłoki. To było zabójstwo? ', 'W Lubinie doszło do zabójstwa? Policjanci i prokurator sprawdzają czy w Lubinie doszło do morderstwa. Dziś po godzinie 8 rano jeden z mieszkańców zauważył leżące przy ul. Leśnej zwłoki.', '2017-02-01 14:23:37+01', 9, '2017-02-01 18:07:11.309+01', false, true, '2017-02-02 21:35:39.216+01');
