INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/usa-trump-oglosil-swojego-kandydata-na-sedziego-sadu-najwyzszego-jest-nim-neil-gorsuch,11749386/', 'USA: Trump ogłosił swojego kandydata na sędziego Sądu Najwyższego. Jest nim Neil Gorsuch ', 'Prezydent USA Donald Trump wskazał kandydata na dziewiątego sędziego Sądu Najwyższego, który nie został obsadzony od roku. To 49-letni konserwatysta Neil Gorsuch. Jego wybór spotkał się już z krytyką liberałów i Demokratów w Senacie, który musi zatwierdzić nominację.', '2017-02-01 08:25:00+01', 10, '2017-02-01 18:07:42.092+01', true, false, '2017-02-02 21:39:14.001+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/wybory-prezydenckie-we-francji-2017-kandydaci-marine-le-pen-idzie-po-wladze-sondaze-sa-laskawe,11747041/', 'Wybory prezydenckie we Francji 2017 [KANDYDACI] Marine Le Pen idzie po władzę? Sondaże są łaskawe', 'Ostatnie sondaże są wyjątkowo łaskawe dla liderki skrajnie prawicowego Frontu Narodowego Marine Le Pen. Nikt nie miał wątpliwości, że polityk cieszy się sporym poparciem, teraz jednak wiadomo na pewno, że podczas pierwszej tury wyborów prezydenckich nie będzie miała żadnej konkurencji.', '2017-01-31 16:39:00+01', 10, '2017-02-01 18:07:42.093+01', false, true, '2017-02-02 21:39:20.369+01');
