INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/usa-trump-odwolal-prokurator-generalna-sally-yates-za-sprzeciw-wobec-nowej-polityki-imigracyjnej,11746049/', 'USA: Trump odwołał prokurator generalną Sally Yates. Za sprzeciw wobec nowej polityki imigracyjnej', 'Pełniąca obowiązki ministra sprawiedliwości i prokuratura generalnego, Sally Yates odwołana ze stanowiska. Kobieta straciła pracę po tym, jak skrytykowała dekret prezydenta Donalda Trumpa, który zaostrza politykę migracyjną – podaje „The Guardian”.', '2017-01-31 11:27:00+01', 10, '2017-02-01 18:07:42.095+01', true, false, '2017-02-02 21:39:34.268+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/iran-przeprowadzil-probe-pocisku-balistycznego-rada-bezpieczenstwa-onz-musi-zareagowac,11745677/', 'Iran przeprowadził próbę pocisku balistycznego. "Rada Bezpieczeństwa ONZ musi zareagować"', 'Biały Dom potwierdza – Iran wystrzelił pocisk batalistyczny średniego zasięgu. Na wtorek zaplanowano pilne posiedzenie Rady Bezpieczeństwa ONZ w tej sprawie – podaje agencja Reutersa.', '2017-01-31 09:18:00+01', 10, '2017-02-01 18:07:42.096+01', true, false, '2017-02-02 21:39:39.683+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/grozny-zatrzymano-mezczyzn-planujacych-zamach-na-przywodce-czeczenii-ramzana-kadyrowa,11744459/', 'Grozny: Zatrzymano mężczyzn planujących zamach na przywódce Czeczenii Ramzana Kadyrowa', 'Rosyjskie służby specjalne zatrzymały trzech mężczyzn podejrzanych o szykowanie zamachu na Ramzana Kadyrowa, promoskiewskiego przywódcę Czeczenii. Zamach miał być dokonany m.in. przy użyciu granatników oraz materiałów wybuchowych.', '2017-01-30 21:01:00+01', 10, '2017-02-01 18:07:42.097+01', true, false, '2017-02-02 21:39:43.477+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/strona-kobiet/kobieta-tygodnia/a/final-miss-universe-2017-zwyciezyla-iris-mittenaere-jak-wypadla-polka-izabella-krzan-zdjecia,11742704/', 'Finał Miss Universe 2017: Zwyciężyła Iris Mittenaere. Jak wypadła Polka Izabella Krzan? [ZDJĘCIA]', 'W nocy z 29 na 30 stycznia w Manili na Filipinach odbyła się gala Miss Universe 2017. Po raz pierwszy od 27 lat tytuł zdobyła Europejka - reprezentantka Francji Iris Mittenaere.', '2017-01-30 14:48:00+01', 10, '2017-02-01 18:07:42.098+01', false, true, '2017-02-02 21:39:46.92+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/dziewczyny-z-londynu-przeciwko-trumpowi-zdjecia,11742101/', 'Dziewczyny z Londynu przeciwko Trumpowi [ZDJĘCIA]', 'Podczas swojego pierwszego dnia urzędowania na fotelu prezydenta – 21 stycznia – Donald Trump spotkał się z protestami kobiet na całym świecie. Ludzie protestowali przeciwko nowej administracji Białego Domu oraz wspierali kobiety w ich walce o równe prawa. Tak też w miniony weekend było w Londynie.', '2017-01-30 12:17:00+01', 10, '2017-02-01 18:07:42.099+01', false, true, '2017-02-02 21:40:08.053+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/niemcy-tragedia-w-bawarii-szesciu-nastolatkow-zmarlo-w-czasie-imprezy-video,11741815/', 'Niemcy: Tragedia w Bawarii. Sześciu nastolatków zmarło w czasie imprezy [VIDEO]', 'Tragicznie skończyła się impreza grupy nastolatków w Bawarii. Jak podaje portal niemieckiej rozgłośni Deutsche Welle ciała sześciu z nich odnaleziono w altanie ogrodowej. Na razie nie wiadomo, co było przyczyną ich śmierci. ZOBACZ VIDEO.', '2017-01-30 11:14:00+01', 10, '2017-02-01 18:07:42.1+01', false, true, '2017-02-02 21:40:10.409+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/usa-protesty-przeciw-polityce-imigracyjnej-trumpa-tu-nie-chodzi-o-religie-video,11741621/', 'USA: Protesty przeciw polityce imigracyjnej Trumpa. "Tu nie chodzi o religię" [VIDEO]', 'Nowy Jork, Waszyngton, Houston, Boston – największe amerykańskie miasta protestują przeciwko zaostrzeniu polityki imigracyjnej przez Donalda Trumpa. Sam polityk powtarza: „dekret nie jest wymierzony w muzułmanów, chodzi o zapewnienie nam bezpieczeństwa”.', '2017-01-30 09:50:00+01', 10, '2017-02-01 18:07:42.101+01', true, false, '2017-02-02 21:40:18.466+01');
