INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/trump-rozmawial-z-przywodcami-rosji-niemiec-francji-japonii-i-australii-glowny-temat-terroryzm,11738656/', 'Trump rozmawiał z przywódcami Rosji, Niemiec, Francji, Japonii i Australii. Główny temat: terroryzm', 'Donald Trump rozmawiał w sobotę przez telefon z liderami Rosji, Niemiec, Francji, Japonii i Australii. W większości były to pierwsze rozmowy nowego amerykańskiego prezydenta z przywódcami tych krajów. Dominowały tematy związane z terroryzmem, jednak nie obyło się bez krytyki - francuski prezydent Francois Hollande ostrzegł Trumpa przed szkodliwą jego zdaniem polityką izolacjonizmu.', '2017-01-29 12:05:00+01', 10, '2017-02-01 18:07:42.102+01', true, false, '2017-02-02 21:40:25.87+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/mur-bedzie-mniej-na-onz-a-tortury-dzialaja-trump-realizuje-przedwyborcze-obietnice,11734584', 'Mur będzie, mniej na ONZ, a „tortury działają”. Trump realizuje przedwyborcze obietnice', 'Donald Trump zaczyna realizować przedwyborcze obietnice, by przywrócić potęgę Ameryce. Ale wiele jego pomysłów, jak ograniczenie napływu muzułmanów do USA, czy zapowiedź przywrócenia osławionych tajnych więzień w innych krajach wzbudzają ogromne kontrowersje, nawet wśród najbliższych ludzi Trumpa.', '2017-01-29 08:30:00+01', 10, '2017-02-01 18:07:42.104+01', true, false, '2017-02-02 21:40:51.398+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/zmarl-brytyjski-aktor-john-hurt-mial-77-lat,11737404/', 'Zmarł brytyjski aktor John Hurt. Miał 77 lat', 'Nie żyje brytyjski aktor John Hurt. Artysta, którego kariera filmowa trwała sześć dekad, miał 77 lat. Hurt zasłynął m.in. tytułową rolą w &#34;Człowieku słoniu&#34;, był również uhonorowany tytułem szlacheckim z rąk królowej Elżbiety II.', '2017-01-28 11:20:00+01', 10, '2017-02-01 18:07:42.104+01', false, true, '2017-02-02 21:40:53.856+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/donald-trump-zamknal-granice-dla-mieszkancow-siedmiu-krajow-muzulmanskich,11737376/', 'Donald Trump zamknął granice dla mieszkańców siedmiu krajów muzułmańskich', 'Prezydent Donald Trump dotrzymał słowa i zaostrzył amerykańską politykę imigracyjną. Na cztery miesiące zawiesił przyjmowanie uchodźców i tymczasowo zakazał wstępu do USA obywatelom Syrii, a także sześciu innych krajów, w których dominuje islam. Trump miał także „przyjazną” rozmowę z prezydentem Meksyku Enrique Peñą Nieto. Politycy ustalili, że na razie nie będą poruszać dzielącej ich kwestii, jaką jest zapłata za mur na granicy obu krajów - sztandarowa obietnica wyborcza Trumpa.', '2017-01-28 11:04:00+01', 10, '2017-02-01 18:07:42.106+01', true, false, '2017-02-02 21:40:57.58+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/niemcy-chca-objac-elektronicznym-nadzorem-potencjalnych-terrorystow,11735760/', 'Niemcy chcą objąć elektronicznym nadzorem potencjalnych terrorystów', 'Zdaniem niemieckich służb na terenie kraju może być 600 ludzi podejrzewanych o terroryzm. To ich powinno się w pierwszym rzędzie objąć elektronicznym nadzorem. Do tego jednak trzeba zmienić obecnie obowiązujące w Niemczech prawo.', '2017-01-27 20:00:00+01', 10, '2017-02-01 18:07:42.107+01', true, false, '2017-02-02 21:41:00.506+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/theresa-may-przed-spotkaniem-z-trumpem-usa-i-wielka-brytania-moga-znow-przewodzic-swiatu-video,11734132/', 'Theresa May przed spotkaniem z Trumpem: USA i Wielka Brytania mogą znów przewodzić światu [VIDEO]', 'Tuż przed spotkaniem z prezydentem USA Donaldem Trumpem, brytyjska premier Theresa May apelowała w Filadelfii: &#34;W czasach pełnych zagrożeń, na naszych dwóch krajach spoczywa odpowiedzialność przewodzenia&#34;. Na spotkaniu w republikańskimi kongresmenami polityk mówiła m.in. o walce z terroryzmem i potrzebie przeciwstawienia się Rosji – podaje CNN.', '2017-01-27 10:34:00+01', 10, '2017-02-01 18:07:42.108+01', true, false, '2017-02-02 21:41:03.645+01');
