INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/polityka/a/petru-i-dutkiewicz-wroclaw-nie-bedzie-pisowski,11749544/', 'Petru i Dutkiewicz: Wrocław nie będzie pisowski', 'Prezydent Wrocławia Rafał Dutkiewicz i przewodniczący Nowoczesnej Ryszard Petru podpisali dziś porozumienie o współpracy we wrocławskiej radzie miejskiej.  - Porozumienie potwierdza naszą współpracę z Nowoczesną. Przygotujemy ciekawą strategię na wybory samorządowe w 2018 roku - mówi Rafał Dutkiewicz, prezydent Wrocławia.', '2017-02-01 11:22:00+01', 11, '2017-02-01 18:09:33.935+01', false, true, '2017-02-02 21:41:52.785+01');
