INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/strefa-biznesu/wiadomosci/a/nie-dzialaja-niezarejestrowane-karty-sim-czy-mozna-odzyskac-numer,11753590/', 'Nie działają niezarejestrowane karty SIM. Czy można odzyskać numer?', 'Do 1 lutego należało zarejestrować swoją kartę SIM. W innym wypadku operatorzy sieci komórkowych zablokowali możliwość wykonywania i odbierania połączeń i SMS-ów. Wiele osób zorientowało się dziś, że ich telefony nie działają. Zapominalscy mogą jeszcze zarejestrować swoją kartę u operatora, będą mieli też ten sam numer. Kartę można także zarejestrować na poczcie, ale nie każdą.', '2017-02-02 12:57:00+01', 8, '2017-02-02 15:55:37.57+01', false, true, '2017-02-02 21:31:08.117+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/kaczynski-i-morawiecki-goscmi-o-rydzyka-juz-w-sobote,11752202/', 'Kaczyński i Morawiecki gośćmi o. Rydzyka - już w sobotę', '- Na  stojąco? Też się nie da... Już ponad 700 osób jest na liście - informuje pracownica WSKSiM w Toruniu, gdy pytamy o bilet na sobotnią konferencję „Odpowiedzialność przedsiębiorców”. Jak ustalił „Super Express”, bilety kosztowały 100 zł lub 150zł z obiadem.', '2017-02-02 11:05:00+01', 8, '2017-02-02 15:55:37.573+01', false, true, '2017-02-02 21:31:23.668+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/aktualnosci/a/protesty-w-rumunii-demonstranci-domagaja-sie-rozwiazania-rzadu-video-zdjecia,11753418/', 'Protesty w Rumunii: Demonstranci domagają się rozwiązania rządu [VIDEO] [ZDJĘCIA]', 'W Rumunii wrze. Tysiące ludzi protestowało przeciwko rządowemu dekretowi znoszącemu kary za niektóre przestępstwa korupcyjne. Opozycja grozi złożeniem wniosku o wotum nieufności dla rządu. Twierdzi bowiem, że nowe prawo ma służyć jedynie politykom partii rządzącej.', '2017-02-02 10:39:00+01', 8, '2017-02-02 15:55:37.576+01', true, false, '2017-02-02 21:31:30.375+01');
