INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/grypa-na-slasku-nie-odpuszcza-4-ofiary-smiertelne-grypy-w-styczniu-w-lutym-bedzie-epidemia-grypy,11750262/', 'Grypa na Śląsku nie odpuszcza: 4 ofiary śmiertelne grypy w styczniu. W lutym będzie epidemia grypy?', 'Grypa szaleje na Śląsku i woj śląskim. W styczniu zachorowało prawie 30 tys. ludzi. Cztery osoby zmarły. Nie było dla nich ratunku. Na razie nie wiadomo, czy grypa już się kończy, czy dopiero najgorsze przed nami. Więcej będzie wiadomo po pierwszym tygodniu lutego, gdy rozpoczęły się lekcje w szkołach po feriach. W szkołach bowiem i innych dużych skupiskach grypa rozprzestrzenia się najszybciej.', '2017-02-02 09:31:00+01', 9, '2017-02-02 15:55:40.813+01', false, true, '2017-02-02 21:38:37.121+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/usa-mieszkancy-krajow-muzulmanskich-sa-zatrzymywani-na-lotniskach-sad-nie-moga-byc-odsylani,11738010/', 'USA: Mieszkańcy krajów muzułmańskich są zatrzymywani na lotniskach. Sąd: Nie mogą być odsyłani', 'Sąd federalny w Nowym Jorku stwierdził, że obywatele siedmiu muzułmańskich krajów, którzy od piątku mają zakaz wstępu do USA i którzy zostali zatrzymani na lotniskach, nie mogą być odesłani do swoich państw. To sukces organizacji oraz tysięcy ludzi, którzy protestowali przeciwko dekretom prezydenta USA Donalda Trumpa. Jednak to nie koniec ich walki - sąd nie zablokował bowiem nowych zasad, a wiele osob pozostanie na razie w areszcie. Donald Trump utrzymuje jednak, że jego dekrety nie są wymierzone w muzułmanów i mają na celu uchronienie kraju przed terroryzmem.', '2017-01-29 13:19:00+01', 10, '2017-02-01 18:07:42.101+01', true, false, '2017-02-02 21:40:21.663+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/w-chyrowie-na-ukrainie-czas-zatrzymal-sie-dawno-temu,11737272', 'W Chyrowie na Ukrainie czas zatrzymał się dawno temu', 'U nas życie jest ciężkie. Nie ma pracy, mało jest młodych, a tych, którzy są zabierają na wojnę - żali się starsza mieszkanka Chyrowa na Ukrainie tuż przy polsko - ukraińskiej granicy.', '2017-02-02 07:00:00+01', 10, '2017-02-02 15:55:43.528+01', false, true, '2017-02-02 21:41:21.138+01');
