INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/opinie/a/kuria-nie-przeprosimy-za-ksiedza-irka-jestesmy-jak-zdradzona-zona,11764250/', 'Kuria: Nie przeprosimy za księdza Irka. Jesteśmy jak zdradzona żona', 'Kościół nie przeprosi wiernych za błędy księdza profesora Waldemara Irka, rektora Papieskiego Fakultetu Teologicznego we Wrocławiu, który prowadził podwójne życie, miał kochankę i dziecko. - Proszę sobie wyobrazić idealne małżeństwo. Wszyscy mówią, że to kochająca się para. W pewnym momencie mężczyzna umiera, a do wdowy przychodzi kobieta i mówi, że jej mąż taki idealny nie był. Opowiada, że mężczyzna zdradzał żonę, a owocem tego jest dziecko. Czy w takim momencie ktoś będzie żądał przeprosin od tej wdowy i mówił, że to ona jest winna? No oczywiście, że nie. Ksiądz Waldemar Irek złożył śluby i nie był im wierny, w jakimś sensie te śluby złamał i w tym kontekście Kościół jest trochę jak ta zdradzona żona - mówi w rozmowie z portalem GazetaWroclawska.pl ksiądz Rafał Kowalski, rzecznik wrocławskiej kurii. Rozmawia z nim Malwina Gadawa.', '2017-02-06 10:07:00+01', 8, '2017-02-06 15:51:43.65+01', true, false, '2017-02-06 16:49:35.381+01');
