INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,795722,szumelda-szefem-kod-na-pomorzu-karys-na-podkarpaciu.html', 'Szumełda szefem KOD na Pomorzu, Karyś na Podkarpaciu', 'Radomir Szumełda został wybrany w sobotę na przewodniczącego regionu Pomorskiego KOD, a Kuba Karyś został szefem KOD na Podkarpaciu. Szumełda był jedynym kandydatem na to stanowisko, poparło go 88 proc. głosujących. Na Podkarpaciu było dwoje kandydatów.', NULL, 17, '2017-02-04 21:32:09.504+01', false, true, '2017-02-04 21:42:29.303+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,795676,paryski-luwr-otwarty-dla-turystow-po-piatkowym-ataku.html', 'Paryski Luwr otwarty dla turystów po piątkowym ataku', 'Muzeum Luwr w Paryżu zostało w sobotę ponownie otwarte dla turystów, w dzień po ataku uzbrojonego mężczyzny na żołnierzy pilnujących tam bezpieczeństwa. Poprawia się stan napastnika, który został poważnie postrzelony przez jednego z wojskowych.', NULL, 17, '2017-02-04 21:32:09.505+01', false, true, '2017-02-04 21:42:31.479+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,795639,stoch-trzeci-w-zawodach-ps-w-skokach-w-oberstdorfie-wygrana-krafta.html', 'Stoch trzeci w zawodach PŚ w skokach w Oberstdorfie, wygrana Krafta', 'Kamil Stoch zajął trzecie miejsce w zawodach Pucharu Świata w Oberstdorfie, pierwszych w tym sezonie na mamucim obiekcie. Zwyciężył Austriak Stefan Kraft przed Niemcem Andreasem Wellingerem. Polak utrzymał prowadzenie w klasyfikacji generalnej cyklu.', NULL, 17, '2017-02-04 21:32:09.506+01', false, true, '2017-02-04 21:42:33.678+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,795629,organizatorzy-gala-cezarow-w-tym-roku-bez-przewodniczacego.html', 'Organizatorzy: gala Cezarów w tym roku bez przewodniczącego', 'Gala wręczenia francuskich nagród filmowych Cezary, zaplanowana na 24 lutego, nie będzie miała przewodniczącego po wycofaniu się pod presją środowisk feministycznych reżysera Romana Polańskiego - poinformowali w sobotę organizatorzy.', NULL, 17, '2017-02-04 21:32:09.507+01', false, true, '2017-02-04 21:42:36.412+01');
