INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,795581,departament-stanu-usa-cofa-obostrzenia-wizowe-po-decyzji-sedziego.html', 'Departament Stanu USA cofa obostrzenia wizowe po decyzji sędziego', 'Departament Stanu USA poinformował w sobotę, że zawiesza tymczasowe unieważnienie wiz dla obcokrajowców z siedmiu krajów w następstwie wstrzymania przez sędziego federalnego ze stanu Waszyngton dekretu wydanego przez prezydenta Donalda Trumpa.', NULL, 17, '2017-02-04 21:32:09.511+01', true, false, '2017-02-04 21:42:40.585+01');
