INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/aktualnosci/a/donald-trump-jako-dzihadysta-i-morderca-statuy-wolnosci-na-okladce-der-spiegel,11761138/', 'Donald Trump jako dżihadysta i morderca Statuy Wolności na okładce "Der Spiegel"', 'Niemiecki tygodnik &#34;Der Spiegel&#34; znalazł pod ostrzałem krytyki z powodu okładki swojego ostatniego numeru. Znajduje się na niej rysunek prezydenta USA Donalda Trumpa z zakrwawionym nożem w jednej ręce i odciętą głową Statuy Wolności w drugiej. Jego autor powiedział, że chciał pokazać podobieństwo Republikanina do tzw. Państwa Islamskiego oraz niszczenie demokracji.', '2017-02-04 19:14:00+01', 8, '2017-02-04 21:31:46.157+01', false, true, '2017-02-04 21:32:51.17+01');
