INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/polityka/a/psl-chce-walczyc-z-planami-pis-powstal-ruch-obrony-polskiej-samorzadnosci,11760862/', 'PSL chce walczyć z planami PiS. Powstał Ruch Obrony Polskiej Samorządności', 'W Lublinie powstała komórka Ruchu Obrony Polskiej Samorządności. Powołało ją PSL, ale ludowcy liczą, że do ruchu przystąpią działacze PiS. - W prywatnych rozmowach mówią, jakie mają zdanie o planach opcji rządzącej - mówi lider PSL, Krzysztof Hetman.', '2017-02-04 16:51:50+01', 8, '2017-02-04 21:31:46.164+01', true, false, '2017-02-04 21:33:27.234+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/polityka/a/kaczynski-i-morawiecki-w-wsksim-w-toruniu,11760930/', 'Kaczyński i Morawiecki w WSKSiM w Toruniu', 'W toruńskiej Wyższej Szkole Kultury Społecznej i Medialnej odbyła się konferencja gospodarcza pod hasłem „Odpowiedzialność przedsiębiorców za Polskę”.', '2017-02-04 15:56:00+01', 8, '2017-02-04 21:31:46.169+01', false, true, '2017-02-04 21:33:33.896+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/bezlitosny-wnuk-znecal-sie-nad-swoja-74letnia-babcia,11760846/', 'Bezlitosny wnuk znęcał się nad swoją 74-letnią babcią', 'W środę, 1 lutego policjanci prewencji z Tarnowskich Gór zatrzymali 34-letniego mężczyznę, który podejrzany jest o znęcanie się nad swoją babcią. Wczoraj prokurator zastosował wobec zatrzymanego policyjny dozór, nakaz opuszczenia domu oraz zakaz zbliżania się do pokrzywdzonej. Mężczyźnie grozi 5 lat więzienia.', '2017-02-04 15:41:45+01', 8, '2017-02-04 21:31:46.17+01', false, true, '2017-02-04 21:33:41.913+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/opinie/a/zaryn-walesa-bedzie-nadal-wazna-osoba-naszej-historii-pozostaje-pytanie-czy-ulegal-esbeckim-hakom,11757508/', 'Żaryn: Wałęsa będzie nadal ważną osobą naszej historii. Pozostaje pytanie czy ulegał esbeckim hakom', '- Dokumenty ze zbioru zastrzeżonego są jak mięso. Teraz musimy poczekać, aż historycy, badacze usmażą nam z nich kotlety. Napiszą książki i artykuły pokazujące, w jaki sposób służby PRL działały w realiach gospodarki wolnorynkowej III Rzeczpospolitej - mówi prof. Jan Żaryn, historyk, senator PiS.', '2017-02-04 12:09:00+01', 8, '2017-02-04 21:31:46.173+01', false, true, '2017-02-04 21:33:58.001+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/francja-sprawca-ataku-pod-luwrem-byl-29letni-egipcjanin-czy-dzialal-sam-video,11760601/', 'Francja: Sprawcą ataku pod Luwrem był 29-letni Egipcjanin. Czy działał sam? [VIDEO]', 'Napastnikiem, który w piątek wtargnął do muzeum Luwr w Paryżu był 29-letni Egipcjanin - poinformowały francuskie służby. Na razie nie wiadomo czy mężczyzna działał sam czy w obrębie siatki terrorystycznej. Atakowi zapobiegli strzegący Luwru żołnierze, jeden z nich został ranny. Sam zamachowiec został postrzelony.', '2017-02-04 10:47:00+01', 8, '2017-02-04 21:31:46.175+01', false, true, '2017-02-04 21:34:01.846+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/sport/a/umorzone-sledztwo-ws-wypadku-krystiana-rempaly-wideo-smierc-zuzlowca-przez-odpiety-kask,11723558/', 'Umorzone śledztwo ws. wypadku Krystiana Rempały WIDEO Śmierć żużlowca przez odpięty kask', 'Potwierdziły się nasze ubiegłotygodniowe informacje. Prokuratura w Rybniku umorzyła śledztwo w sprawie wypadku ze skutkiem śmiertelnym Krystiana Rempały na torze w Rybniku. Według prokuratury, Krystian Rempała w chwili wypadku nie miał zapiętego kasku. - To jakaś parodia - kwituje ojciec zmarłego żużlowca.', '2017-02-04 11:13:00+01', 8, '2017-02-04 21:31:46.174+01', false, true, '2017-02-04 21:34:05.673+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/polityka/a/szczyt-ue-na-malcie-premier-szydlo-skrytykowala-list-tuska-wywoluje-atmosfere-strachu,11760591/', 'Szczyt UE na Malcie: Premier Szydło skrytykowała list Tuska. "Wywołuje atmosferę strachu"', '- Można stawiać wiele pytań, można mieć wiele obaw, ale nie można straszyć - powiedziała premier Beata Szydło na temat polityki Unii Europejskiej wobec nowej administracji Stanów Zjednoczonych. - Politycy europejscy, którzy próbują wywoływać atmosferę strachu, nawet w wypowiedziach medialnych czy listach, popełniają błąd - dodała odnosząc się do niedawnego listu Donalda Tuska do szefów państw i rządów UE.', '2017-02-04 10:33:00+01', 8, '2017-02-04 21:31:46.176+01', false, true, '2017-02-04 21:34:08.671+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/swiat/a/usa-donald-trump-odpowiada-na-decyzje-sadu-ten-wyrok-jest-niedorzeczny,11760571/', 'USA. Donald Trump odpowiada na decyzję sądu: "Ten wyrok jest niedorzeczny"', 'Kontrowersyjny zakaz wstępu do USA dla obywateli siedmiu krajów islamskich został zablokowany przez sędziego federalnego z Seattle. Aktywiści i demonstranci świętują, a Departament Sprawiedliwości zapowiada apelację. To duża porażka prezydenta Donalda Trumpa, który zapowiedział, że wyrok ogłoszony przez &#34;tak zwanego sędziego&#34; zostanie zniesiony. Linie lotniczne już zniosły zakaz, który obowiązywał przez tydzień.', '2017-02-04 10:22:00+01', 8, '2017-02-04 21:31:46.177+01', true, false, '2017-02-04 21:34:11.805+01');
