INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/dodatki/rozmaitosci/g/robil-zdjecia-tym-samym-ludziom-po-30-latach-galeria,11761172,22569710/', 'Robił zdjęcia tym samym ludziom po 30 latach [GALERIA]', 'Chris Porsz, uliczny fotograf z Wielkiej Brytanii, postanowił wyśledzić po 30, a czasem nawet 40 latach, bohaterów swoich starych zdjęć i zrobić im niemal identyczne fotografie, ilustrujące, jak bardzo się zmienili. Część zdjęć ukazuje dawnych buntowników, którzy ułożyli sobie życie, niektóre to historie sukcesu, a niektóre (w szczególności zdjęcie flecisty) są przejmująco smutne. Zobaczcie sami i spróbujcie wyobrazić sobie niedopowiedziane historie kryjące się za każdym ze zdjęć.', '2017-02-04 20:28:00+01', 8, '2017-02-05 20:42:02.442+01', false, true, '2017-02-05 21:11:55.155+01');
