INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/a/mikolow-zakochany-burmistrz-nie-widzi-podstaw-do-zwolnienia-asystentki,11773605/', 'Mikołów: zakochany burmistrz nie widzi podstaw do zwolnienia asystentki', 'Ciąg dalszy sprawy romansu burmistrza Mikołowa Stanisława Piechuli i jego asystentki. Przypominamy, że w poniedziałek burmistrz na swoim profilu na Facebooku wydał oświadczenie, w którym przyznał się do romansu ze swoją podwładną. W internecie zawrzało, dlatego postanowiliśmy sprawdzić, jak sytuacja wygląda u źródła. Okazuje się, że mimo burzy wywołanej przez kontrowersyjny wpis burmistrza, w Urzędzie Miasta wszystko pozostało bez zmian. Pani Aleksandra Czech nadal pełni funkcję asystentki burmistrza.', '2017-02-08 15:11:00+01', 8, '2017-02-08 16:12:11.815+01', false, true, '2017-02-08 16:15:35.748+01');
