INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/strona-kobiet/macierzynstwo/a/marek-michalak-milion-dzieci-w-polsce-nie-otrzymuje-alimentow,11777971/', 'Marek Michalak: Milion dzieci w Polsce nie otrzymuje alimentów', '- To niemal co dziesiąte dziecko i młoda osoba do 25. roku życia. W grupie do 18 lat pokrzywdzonych jest jeszcze więcej – 14% - powiedział podczas konferencji prasowej rzecznik praw dziecka Marek Michalak. Konferencję prasową przerwali członkowie stowarzyszenia „Dzielny Tata”, którzy domagali się przywrócenia im prawa do kontaktu z dziećmi. Nazwali Michalaka kłamcą i oprawcą praw dziecka.', '2017-02-09 15:23:32+01', 8, '2017-02-09 16:03:09.382+01', false, true, '2017-02-09 17:33:21.378+01');
