INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/polityka/a/expose-witolda-waszczykowskiego-weszlismy-do-powaznej-gry,11776973/', 'Expose Witolda Waszczykowskiego: Weszliśmy do poważnej gry', 'W trwającym 70 minut exposé Witold Waszczykowski zapewniał, że polska polityka zagraniczna zmieniła swój charakter. – Przywróciliśmy jej podmiotowość i właściwą hierarchię priorytetów, na której czele jest dobro Polski – mówił do posłów i obecnych przedstawicieli korpusu dyplomatycznego. W tej chwili trwają przemówienia posłów opozycji.', '2017-02-09 11:47:00+01', 8, '2017-02-09 16:03:09.397+01', true, false, '2017-02-09 17:34:57.591+01');
