INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.polskatimes.pl/fakty/kraj/a/mordujac-syna-zlamal-noz-i-poszedl-na-papierosa-skazany-ryszard-p-jest-na-wolnosci-dlaczego,11773263/', 'Mordując syna, złamał nóż i... poszedł na papierosa. Skazany Ryszard P. jest na wolności. Dlaczego?', 'Ryszard P., skazany przez zielonogórski sąd we wrześniu 2016 roku za zabójstwo syna w Sulechowie na 8 lat więzienia, niespodziewanie wyszedł na wolność. Mordując syna, zadawał ciosy do chwili, aż złamał nóż. Po wszystkim poszedł na papierosa. Sąd apelacyjny, w środę, 8 lutego, uznał jednak, że to nie było morderstwo, ale obrona konieczna.', '2017-02-08 19:14:25+01', 9, '2017-02-08 20:17:24.437+01', false, true, '2017-02-08 20:19:57.888+01');
