INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Plus-Minus/302099937-Monika-Rosa-Wolny-rynek-wszystkiego-nie-zalatwi.html', 'Rosa: Wolny rynek wszystkiego nie załatwi', 'Ważne jest, by ludzie chcieli działać w ruchach społecznych, organizacjach. By nie zamykali się w domach, myśląc: nic nie możemy zrobić. Dlatego szliśmy w marszach. Razem z tysiącami ludzi.', '2017-02-09 17:30:00+01', 12, '2017-02-09 20:03:33.596+01', false, true, '2017-02-09 20:10:42.364+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Plus-Minus/302099939-Adam-Kucharski-o-tym-co-mowi-o-nas-poczucie-humoru.html', 'Adam Kucharski: Odmienne stany dowcipu', 'Humor ma wiele wymiarów. Psychologia mówi o czterech tzw. stylach humoru, dzięki którym możemy wejść w relację z innymi ludźmi w zupełnie różny sposób.', '2017-02-09 17:30:00+01', 12, '2017-02-09 20:03:33.599+01', false, true, '2017-02-09 20:10:48.324+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Plus-Minus/302099940-Stand-up-i-jego-popularnosc-Blaznom-wolno-wiecej.html', 'Błaznom wolno więcej', 'Młodzież ma już dość czerstwych grup kabaretowych oraz ich materiału uszytego pod telewizję i masowe gusty. Dość wymuszonego śmiechu z odgrzewanych żartów na ciągle te same tematy. Stąd popularność stand-upu. Jego mistrzowie głoszą otwarcie nawet najbardziej brutalne prawdy.', '2017-02-09 17:30:00+01', 12, '2017-02-09 20:03:33.601+01', false, true, '2017-02-09 20:10:57.238+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Plus-Minus/302099942-Humor-polityczny-Co-cie-nie-osmieszy-to-cie-ogrzeje.html', 'Co cię nie ośmieszy, to cię ogrzeje', 'Polityczny humor może porządkować świat, ale może też być formą obrony przed nim. Nie po to wszak wybieramy tę lub inną władzę, żeby było śmiesznie i wesoło, ale odwrotnie, po to, by zbyt śmiesznie i całkiem groteskowo właśnie nie było.', '2017-02-09 17:30:00+01', 12, '2017-02-09 20:03:33.603+01', false, true, '2017-02-09 20:10:59.444+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Rzad-PiS/170208871-Szef-MSZ-Witold-Waszczykowski-do-opozycji-nie-bedzie-jak-bylo.html', 'Waszczykowski: Nie będzie jak było', 'Nie chcecie rozmawiać o przyszłości, o nowych rozwiązaniach, tylko o resecie - żeby było jak było; no więc zapowiadam: nie będzie jak było - podkreślił w Sejmie szef MSZ Witold Waszczykowski, zwracając się do posłów.', '2017-02-09 17:14:37+01', 12, '2017-02-09 20:03:33.605+01', false, true, '2017-02-09 20:11:01.885+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Spor-o-in-vitro/170208872-Wroclaw-Rada-Miasta-odrzucila-uchwale-dot-finansowania-przez-miasto-in-vitro.html', 'Wrocław: Odrzucono finansowanie in vitro', 'Rada Miasta Wrocławia odrzuciła uchwałę, która miała wprowadzić w mieście program dofinansowanie leczenia niepłodności metodą in vitro. Projekt autorstwa radnych Nowoczesnej zakładał, że miasto przeznaczy na program rocznie 2,1 mln zł.', '2017-02-09 17:03:12+01', 12, '2017-02-09 20:03:33.606+01', false, true, '2017-02-09 20:11:13.264+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,800069,sad-odrzucil-wnioski-o-areszt-dwu-warszawskich-urzednikow-ws-reprywatyzacji.html', 'Sąd odrzucił wnioski o areszt dwu warszawskich urzędników ws. reprywatyzacji', 'Wrocławski sąd odrzucił w środę wnioski prokuratury o tymczasowe aresztowanie 2 urzędników stołecznego ratusza: Mariusza P. i Gertrudy J.-F., podejrzanych o niedopełnienie obowiązków urzędniczych w związku z reprywatyzacją w Warszawie.', NULL, 17, '2017-02-08 20:17:32.974+01', false, true, '2017-02-08 20:27:13.81+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,800010,rumunski-rzad-przetrwal-wotum-nieufnosci.html', 'Rumuński rząd przetrwał wotum nieufności', 'Socjaldemokratyczny rząd Rumunii przetrwał w środę zgodnie z przewidywaniem głosowanie nad wnioskiem o wotum nieufności zainicjowane przez opozycję po masowych protestach Rumunów, które zmusiły gabinet do wycofania się z kontrowersyjnego rozporządzenia.', NULL, 17, '2017-02-08 20:17:32.976+01', false, true, '2017-02-08 20:27:15.09+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,799989,sasin-mozliwe-sa-daleko-idace-zmiany-w-projekcie-dotyczacym-ustroju-warszawy.html', 'Sasin: możliwe są daleko idące zmiany w projekcie dotyczącym ustroju Warszawy ', 'Możliwe są daleko idące zmiany w projekcie dot. ustroju Warszawy, również jeśli chodzi o zakres terytorialny tworzonej metropolii - zadeklarował w środę poseł PiS Jacek Sasin. Z kolei wojewoda mazowiecki Zdzisław Sipiera zadeklarował, że "nie ma zamiar ingerować w to, co chcą gminy".', NULL, 17, '2017-02-08 20:17:32.978+01', true, false, '2017-02-08 20:27:30.717+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,799947,podpisano-umowe-w-sprawie-przekazania-gruntow-pkp-na-realizacje-programu-mieszkanie-plus.html', 'Podpisano umowę w sprawie przekazania gruntów PKP na realizację programu Mieszkanie Plus', 'Na ok. 250 ha przekazanych przez PKP SA na realizację programu Mieszkanie Plus ma powstać nawet ok. 40 tys. mieszkań. Umowę w sprawie przekazania gruntów między BGK Nieruchomości, PKP SA i kolejową spółką deweloperską XCity Investment podpisano w środę w Poznaniu.', NULL, 17, '2017-02-08 20:17:32.982+01', true, false, '2017-02-08 20:27:35.858+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,799885,66-lat-temu-wykonano-wyrok-smierci-na-majorze-zygmuncie-szendzielarzu-lupaszce.html', '66 lat temu wykonano wyrok śmierci na majorze Zygmuncie Szendzielarzu "Łupaszce"', '66 lat temu, 8 lutego 1951 r., w więzieniu na Mokotowie wykonano wyrok śmierci na mjr. Zygmuncie Szendzielarzu "Łupaszce" - legendarnym dowódcy V Wileńskiej Brygady AK, a następnie oddziałów partyzanckich Wileńskiego Okręgu AK. W 2016 r. "Łupaszka" został pochowany z wojskowym ceremoniałem na Wojskowych Powązkach.', NULL, 17, '2017-02-08 20:17:32.984+01', false, true, '2017-02-08 20:27:46.631+01');
INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.rp.pl/Rzad-PiS/170208985-MON-Decyzje-Bartlomieja-Misieiwcza-ws-CEK-NATO-zgodne-z-prawem.html', 'MON: Decyzje Misiewicza zgodne z prawem', 'Decyzje podejmowane na polecenie szefa MON przez jego ówczesnego pełnomocnika ds. utworzenia CEK NATO Bartłomieja Misiewicza, oficerów SKW i ŻW realizowane były zgodnie z prawem - zapewniło MON, odnosząc się do wszczęcia śledztwa w tej sprawie przez prokuraturę.', '2017-02-08 22:00:15+01', 12, '2017-02-09 07:07:11.065+01', false, true, '2017-02-09 18:00:55.512+01');
