INSERT INTO rss_draft_entries (link, title, lead_content, pub_date, rssfeed_id, created_date, accepted, rejected, modyfied_date) VALUES ('http://www.pap.pl/aktualnosci/news,803722,laureat-konkursu-student-wynalazca-stworzyl-innowacyjna-laske-dla-niewidomych.html', 'Laureat konkursu „Student-wynalazca” stworzył innowacyjną laskę dla niewidomych', 'Lekką, wyposażoną m.in. w GPS laskę dla niewidomych i niedowidzących skonstruował student Politechniki Rzeszowskiej, Łukasz Kolman. Laska ułatwia poruszanie się np. w domu, po mieście. Jeśli jej testy zakończą się pomyślnie, Kolman chciałby ją wdrożyć do produkcji.', NULL, 17, '2017-02-11 10:08:24.659+01', false, false, NULL);
