INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (45, 'http://www.polskatimes.pl/fakty/swiat/a/usa-protesty-przeciw-polityce-imigracyjnej-trumpa-tu-nie-chodzi-o-religie-video,11741621/', 'USA: Protesty przeciw polityce imigracyjnej Trumpa. "Tu nie chodzi o religię"', 'Nowy Jork, Waszyngton, Houston, Boston – największe amerykańskie miasta protestują przeciwko zaostrzeniu polityki imigracyjnej przez Donalda Trumpa. Sam polityk powtarza: „dekret nie jest wymierzony w muzułmanów, chodzi o zapewnienie nam bezpieczeństwa”.', '2017-01-30 09:50:00+01', 10, '2017-02-02 21:40:18.468+01', '2017-02-02 21:40:18.468+01', 3);
