INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (48, 'http://www.polskatimes.pl/fakty/swiat/a/mur-bedzie-mniej-na-onz-a-tortury-dzialaja-trump-realizuje-przedwyborcze-obietnice,11734584', 'Mur będzie, mniej na ONZ, a „tortury działają”. Trump realizuje przedwyborcze obietnice', 'Donald Trump zaczyna realizować przedwyborcze obietnice, by przywrócić potęgę Ameryce. Ale wiele jego pomysłów, jak ograniczenie napływu muzułmanów do USA, czy zapowiedź przywrócenia osławionych tajnych więzień w innych krajach wzbudzają ogromne kontrowersje, nawet wśród najbliższych ludzi Trumpa.', '2017-01-29 08:30:00+01', 10, '2017-02-02 21:40:51.401+01', '2017-02-02 21:40:51.401+01', 3);
