INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (28, 'http://www.polskatimes.pl/fakty/kraj/a/gangsterzy-z-pruszkowa-przesluchiwani-w-szczecinie,11750234/', 'Gangsterzy z Pruszkowa przesłuchiwani w Szczecinie', 'Koło godz. 13 członkowie tzw. starego Pruszkowa zostali dowiezieni do Prokuratury Regionalnej w Szczecinie. Mają usłyszeć zarzuty. To m.in. Andrzej Z. pseudonim Słowik, Leszek D. pseudonim Wańka i Janusz P. pseudonim Parasol. Łącznie zatrzymano 14 osób.', '2017-02-01 14:18:00+01', 8, '2017-02-02 21:29:28.824+01', '2017-02-02 21:29:28.824+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (232, 'http://www.polskatimes.pl/fakty/polityka/a/psl-chce-walczyc-z-planami-pis-powstal-ruch-obrony-polskiej-samorzadnosci,11760862/', 'PSL chce walczyć z planami PiS. Powstał Ruch Obrony Polskiej Samorządności', 'W Lublinie powstała komórka Ruchu Obrony Polskiej Samorządności. Powołało ją PSL, ale ludowcy liczą, że do ruchu przystąpią działacze PiS. - W prywatnych rozmowach mówią, jakie mają zdanie o planach opcji rządzącej - mówi lider PSL, Krzysztof Hetman.', '2017-02-04 16:51:50+01', 8, '2017-02-04 21:33:27.237+01', '2017-02-04 21:33:27.237+01', 1);
