INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (238, 'http://www.rp.pl/Smog/170209546-Policjanci-beda-wyposazeni-w-maski-chroniace-przed-smogiem.html', 'Policjanci będą wyposażeni w maski chroniące przed smogiem', 'Policjanci będą mogli korzystać z masek chroniących przed smogiem; Komenda Główna Policji chce w nie zaopatrzyć funkcjonariuszy służących na ulicach. Zdrowie policjantów stawiamy na pierwszym miejscu- mówił kom. Andrzej Browarek z biura prasowego KGP.', '2017-02-04 08:09:07+01', 12, '2017-02-04 21:37:32.605+01', '2017-02-04 21:37:32.605+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (27, 'http://www.polskatimes.pl/fakty/kraj/a/pruszkow-znow-w-rekach-policji-slowik-parasol-i-wanka-zostali-zatrzymani-za-wyludzanie-vatu,11750534/', 'Pruszków znów w rękach policji. „Słowik”, „Parasol” i „Wańka” zostali zatrzymani za wyłudzanie VAT-u', 'Centralne Biuro Śledcze Policji zatrzymało w Warszawie i na Dolnym Śląsku 14 osób, m.in. byłych członków gangu pruszkowskiego: Andrzeja Z. ps. „Słowik”, Janusza P. ps. „Parasol” i Leszka D. ps. „Wańka”. Zatrzymani, po odbyciu wieloletnich kar i wyjściu na wolność, zajęli się wyłudzeniami VAT-u.', '2017-02-01 16:01:00+01', 8, '2017-02-02 21:27:51.052+01', '2017-02-02 21:27:51.052+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (37, 'http://www.polskatimes.pl/aktualnosci/a/protesty-w-rumunii-demonstranci-domagaja-sie-rozwiazania-rzadu-video-zdjecia,11753418/', 'Protesty w Rumunii: Demonstranci domagają się rozwiązania rządu', 'W Rumunii wrze. Tysiące ludzi protestowało przeciwko rządowemu dekretowi znoszącemu kary za niektóre przestępstwa korupcyjne. Opozycja grozi złożeniem wniosku o wotum nieufności dla rządu. Twierdzi bowiem, że nowe prawo ma służyć jedynie politykom partii rządzącej.', '2017-02-02 10:39:00+01', 8, '2017-02-02 21:31:30.379+01', '2017-02-02 21:31:30.379+01', 5);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (118, 'http://www.polskatimes.pl/fakty/polityka/a/powiekszenie-warszawy-jacek-sasin-tak-pis-chce-aby-warszawa-objela-33-gminy-video-mapa,11754174/', 'Powiększenie Warszawy. Jacek Sasin: "Tak, PiS chce, aby Warszawa objęła 33 gminy"', 'Na zorganizowanej w Sejmie przez Prawo i Sprawiedliwość konferencji Jacek Sasin potwierdził wcześniejsze zapowiedzi partii rządzącej dotyczące poszerzenia terytorium Warszawy do 33 gmin. Do gminy warszawskiej dołączą 32. mniejsze gminy, w tym m.in. Grodzisk Mazowiecki, Karczew czy Wołomin. - Z poziomu stołecznego miasta Warszawy będą realizowane tylko wielkie projekty inwestycyjne - powiedział Sasin.', '2017-02-02 13:04:00+01', 8, '2017-02-02 22:39:47.322+01', '2017-02-02 22:39:47.322+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (163, 'http://www.polskatimes.pl/fakty/swiat/a/buldogi-harcuja-ale-putin-sobie-radzi-oleg-erowinkin-nie-zyje-zatrzymania-w-fsb-i-kaspersky-lab,11759485/', 'Buldogi harcują, ale Putin sobie radzi. Oleg Erowinkin nie żyje, zatrzymania w FSB i Kaspersky Lab', 'Raz na jakiś czas na szczytach rosyjskiej władzy dochodzi do nieoczekiwanych zmian. To znak, że Władimir Putin pokazuje swoim kolegom z KGB, że jest on niepodzielnym władcą kraju.', '2017-02-03 18:36:00+01', 8, '2017-02-03 22:33:30.018+01', '2017-02-03 22:33:30.018+01', 5);
