INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (46, 'http://www.polskatimes.pl/fakty/swiat/a/usa-mieszkancy-krajow-muzulmanskich-sa-zatrzymywani-na-lotniskach-sad-nie-moga-byc-odsylani,11738010/', 'USA: Mieszkańcy krajów muzułmańskich są zatrzymywani na lotniskach. Sąd: Nie mogą być odsyłani', 'Sąd federalny w Nowym Jorku stwierdził, że obywatele siedmiu muzułmańskich krajów, którzy od piątku mają zakaz wstępu do USA i którzy zostali zatrzymani na lotniskach, nie mogą być odesłani do swoich państw. To sukces organizacji oraz tysięcy ludzi, którzy protestowali przeciwko dekretom prezydenta USA Donalda Trumpa. Jednak to nie koniec ich walki - sąd nie zablokował bowiem nowych zasad, a wiele osob pozostanie na razie w areszcie. Donald Trump utrzymuje jednak, że jego dekrety nie są wymierzone w muzułmanów i mają na celu uchronienie kraju przed terroryzmem.', '2017-01-29 13:19:00+01', 10, '2017-02-02 21:40:21.667+01', '2017-02-02 21:40:21.667+01', 3);
