INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (429, 'http://www.pap.pl/aktualnosci/news,796884,premier-tam-gdzie-gina-ludzie-musi-isc-pomoc-miedzynarodowa.html', 'Premier: tam, gdzie giną ludzie, musi iść pomoc międzynarodowa', 'Tam, gdzie giną ludzie, gdzie cierpią ludzie, musi iść mądra pomoc międzynarodowa - powiedziała w poniedziałek premier Beata Szydło. Źle się dzieje, kiedy tak wrażliwy temat wykorzystywany jest do gier politycznych - dodała.', NULL, 17, '2017-02-06 17:06:12.507+01', '2017-02-06 17:06:12.507+01', 1);
