INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (441, 'http://www.rp.pl/Prawo-i-Sprawiedliwosc/170209293-Mazurek-klub-PiS-ani-prezes-Kaczynski-nie-maja-wplywu-na-kadry-w-MON.html', '"PiS i Kaczyński nie mają wpływu na MON"', 'Pytania dotyczące rzecznika MON Bartłomieja Misiewicza należy zadawać szefowi tego resortu Antoniemu Macierewiczowi; klub PiS ani prezes partii Jarosław Kaczyński nie mają wpływu na politykę kadrową w danym urzędzie - podkreśliła Beata Mazurek (PiS).', '2017-02-06 16:16:08+01', 12, '2017-02-06 22:24:03.201+01', '2017-02-06 22:24:03.201+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (433, 'http://www.polskatimes.pl/fakty/a/macierewicz-bartlomiej-misiewicz-jest-pomawiany-sprawa-zajma-sie-sluzby-i-prokuratura,11765274/', 'Macierewicz: Bartłomiej Misiewicz jest pomawiany. Sprawą zajmą się służby i prokuratura', 'Minister obrony Antoni Macierewicz zdementował w poniedziałek doniesienia medialne, dotyczące odejścia z MON rzecznika prasowego i szefa gabinetu politycznego ministerstwa Bartłomieja Misiewicza. - Nadal jest on pracownikiem ministerstwa, obecnie wykorzystuje urlop – mówił. Zapowiedział także kroki prawne.', '2017-02-06 14:41:00+01', 8, '2017-02-06 22:08:19.149+01', '2017-02-06 22:08:19.149+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (434, 'http://www.polskatimes.pl/fakty/a/26-marca-referendum-w-warszawie-ws-powiekszenia-stolicy-o-33-gminy-to-histeria-opozycji,11765112/', '26 marca referendum w Warszawie ws. powiększenia stolicy o 33 gminy. "To histeria opozycji"', 'Prawo i Sprawiedliwość ustępuje w sprawie rozszerzenia granic Warszawy. Poseł Jacek Sasin podał w poniedziałek, że projekt ustawy metropolitalnej, zakładającej powiększenie Warszawy do 33 gmin, nie będzie w najbliższym czasie procedowany. Niezależnie od tych deklaracji polityków PiS, radni Warszawy podjęli w głosowaniu decyzję o zorganizowaniu referendum metropolitalnego. Odbędzie się ono 26 marca.', '2017-02-06 14:03:00+01', 8, '2017-02-06 22:08:28.247+01', '2017-02-06 22:08:28.247+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (435, 'http://www.polskatimes.pl/fakty/kraj/a/beda-miejskie-wypozyczalnie-elektrycznych-aut-znamy-szczegoly-ceny,11764260/', 'Będą miejskie wypożyczalnie elektrycznych aut. Znamy szczegóły', 'Od 2018 roku we Wrocławiu będziemy mogli wypożyczyć auto na prąd z sieci miejskich wypożyczalni, podobnie jak dziś robimy to z rowerami. Tak deklaruje firma Enigma z Warszawy, która zostanie operatorem systemu wypożyczalni. Do Wrocławia trafi 200 nissanów leaf, które będziemy mogli wypożyczyć najprawdopodobniej w cenie ok. 1 - 1,20 zł za kilometr jazdy. Co więcej, będziemy nimi mogli wjechać tam, gdzie zwykłe auta mają zakaz, czyli np. na Ostrów Tumski.', '2017-02-06 10:39:00+01', 9, '2017-02-06 22:21:18.363+01', '2017-02-06 22:21:18.363+01', 1);
