INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (591, 'http://www.pap.pl/aktualnosci/news,798880,zarzuty-przestepstw-urzedniczych-dla-3-zatrzymanych-ws-reprywatyzacji.html', 'Zarzuty przestępstw urzędniczych dla 3 zatrzymanych ws. reprywatyzacji', 'Zarzuty niedopełnienia obowiązków urzędniczych usłyszeli urzędnicy stołecznego ratusza Mariusz P. i Gertruda J.-F. oraz niezatrudniony już w ratuszu radca prawny Jerzy M. - poinformowała we wtorek rzecznik Prokuratury Regionalnej we Wrocławiu Anna Zimoląg.', NULL, 17, '2017-02-08 16:51:06.435+01', '2017-02-08 16:51:06.435+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (592, 'http://www.pap.pl/aktualnosci/news,798835,kaczynski-o-spotkaniu-z-merkel-rozmowa-w-dobrej-atmosferze-min-o-brexicie-i-ue.html', 'Kaczyński o spotkaniu z Merkel: rozmowa w dobrej atmosferze, m.in. o Brexicie i UE', 'To była rozmowa w dobrej atmosferze; rozmowa osób, które się znają i są w stanie ze sobą rozmawiać - powiedział prezes PiS Jarosław Kaczyński po wtorkowym spotkaniu z kanclerz Niemiec Angelą Merkel. Prezes PiS poinformował, że rozmowa dotyczyła m.in. Brexitu i przyszłości UE.', NULL, 17, '2017-02-08 16:51:11.683+01', '2017-02-08 16:51:11.683+01', 1);
