INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (596, 'http://www.polskatimes.pl/fakty/swiat/a/egipcjanin-abdallah-elhamahmi-ktory-zaatakowal-przed-luwrem-kontaktowal-sie-z-rodakiem-w-polsce,11774301/', 'Egipcjanin Abdallah el-Hamahmi, który zaatakował przed Luwrem, kontaktował się z rodakiem w Polsce', 'W niedawnym zamachu terrorystycznym na paryski Luwr pojawia się polski wątek. Jak podaje dziennik "Le Figaro", zamachowiec, Egipcjanin Abdallah el-Hamahmi, który zaatakował 3 lutego żołnierza patrolującego okolice przed muzeum, przyleciał do Francji z Dubaju w styczniu. Przesłał on następnie w dwóch transzach przez Western Union pięć tysięcy euro swojemu rodakowi w Polsce. Francuska policja podała, że przelewy zostały dokonane 31 stycznia i 1 lutego. Nazwisko odbiorcy tych pieniędzy zna i francuska, i polska policja.', '2017-02-08 17:23:00+01', 8, '2017-02-08 20:19:49.918+01', '2017-02-08 20:19:49.918+01', 5);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (597, 'http://www.polskatimes.pl/fakty/kraj/a/grupa-przestepcza-wyludzala-vat-skarb-panstwa-stracil-700-mln-zl-zastosowali-schemat-z-pitbulla-3,11774427/', 'Grupa przestępcza wyłudzała VAT. Skarb Państwa stracił 700 mln zł. Zastosowali schemat z Pitbulla 3 ', 'Prokuratura Regionalna w Białymstoku prowadzi śledztwo dotyczące zorganizowanej grupy przestępczej zajmującej się wyłudzaniem VAT w związku z wprowadzaniem do obrotu na terenie Polski paliw płynnych. Wyliczenia dokonane przez UKS w Białymstoku wskazują, że na przestępczej działalności grupy przestępczej Skarb Państwa stracił ponad 700 milionów złotych.', '2017-02-08 18:26:00+01', 9, '2017-02-08 20:20:03.546+01', '2017-02-08 20:20:03.546+01', 1);
