INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (614, 'http://www.pap.pl/aktualnosci/news,799989,sasin-mozliwe-sa-daleko-idace-zmiany-w-projekcie-dotyczacym-ustroju-warszawy.html', 'Sasin: możliwe są daleko idące zmiany w projekcie dotyczącym ustroju Warszawy ', 'Możliwe są daleko idące zmiany w projekcie dot. ustroju Warszawy, również jeśli chodzi o zakres terytorialny tworzonej metropolii - zadeklarował w środę poseł PiS Jacek Sasin. Z kolei wojewoda mazowiecki Zdzisław Sipiera zadeklarował, że "nie ma zamiar ingerować w to, co chcą gminy".', NULL, 17, '2017-02-08 20:27:30.72+01', '2017-02-08 20:27:30.72+01', 1);
