INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (620, 'http://www.polskatimes.pl/fakty/kraj/a/rada-miejska-za-przyjeciem-rodzin-z-aleppo-radni-pis-przeciw,11777235/', 'Rada miejska za przyjęciem rodzin z Aleppo. Radni PiS przeciw', 'Rada Miejska Wrocławia przyjęła dziś stanowisko w sprawie przyjęcia przez Wrocław rodzin z ogarniętego działaniami wojennymi Aleppo. Za przyjęciem stanowiska głosowało 23 radnych, 14 było przeciw.', '2017-02-09 14:22:00+01', 8, '2017-02-09 17:33:32.053+01', '2017-02-09 17:33:32.053+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (621, 'http://www.polskatimes.pl/fakty/swiat/a/angela-merkel-obiecuje-masowe-deportacje-imigrantow,11777263/', 'Angela Merkel obiecuje masowe deportacje imigrantów', 'Niemiecka kanclerz Angela Merkel jest pod olbrzymią presją od czasu zamachu na jarmark świąteczny w Berlinie, w którym zginęło 12 osób, a 50 zostało rannych. Walcząc o głosy przyszłych wyborców, polityk obiecała przyspieszyć deportacje imigrantów. Do tej pory aż 40 proc. wniosków o azyl było odrzucanych.', '2017-02-09 12:57:00+01', 8, '2017-02-09 17:34:04.48+01', '2017-02-09 17:34:04.48+01', 5);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (622, 'http://www.polskatimes.pl/fakty/swiat/a/student-z-turcji-pobity-w-lublinie-jeszcze-w-pazdzierniku-mowil-o-otwartosci-polakow,11777009/', 'Student z Turcji pobity w Lublinie. Jeszcze w październiku mówił o otwartości Polaków', '25-letni Deniz, student z Turcji, który został pobity na placu Kaczyńskiego w Lublinie, jeszcze w październiku ubiegłego roku mówił o otwartości Polaków na obcokrajowców. Był wtedy gościem programu w internetowej telewizji.', '2017-02-09 12:41:00+01', 8, '2017-02-09 17:34:21.391+01', '2017-02-09 17:34:21.391+01', 1);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (623, 'http://www.polskatimes.pl/fakty/swiat/a/wybuch-w-elektrowni-atomowej-we-francji-nie-ma-grozby-skazenia,11777177/', 'Wybuch w elektrowni atomowej we Francji. Nie ma groźby skażenia', 'Dopiero co pojawiły się informacje o wybuchu w paryskim metrze, a już agencje informują o wybuchu, do którego miało dojść w elektrowni atomowej w Flamanville, na północy kraju. Jak podają lokalne media, pięć osób uległo lekkiemu zatruciu – podaje agencja AFP.', '2017-02-09 12:30:00+01', 8, '2017-02-09 17:34:40.602+01', '2017-02-09 17:34:40.602+01', 5);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (624, 'http://www.polskatimes.pl/fakty/polityka/a/expose-witolda-waszczykowskiego-weszlismy-do-powaznej-gry,11776973/', 'Expose Witolda Waszczykowskiego: Weszliśmy do poważnej gry', 'W trwającym 70 minut exposé Witold Waszczykowski zapewniał, że polska polityka zagraniczna zmieniła swój charakter. – Przywróciliśmy jej podmiotowość i właściwą hierarchię priorytetów, na której czele jest dobro Polski – mówił do posłów i obecnych przedstawicieli korpusu dyplomatycznego. W tej chwili trwają przemówienia posłów opozycji.', '2017-02-09 11:47:00+01', 8, '2017-02-09 17:34:57.595+01', '2017-02-09 17:34:57.595+01', 1);
