INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (754, 'http://www.rp.pl/Gospodarka/302109903-Rozmowy-kredytodawcow-z-Grecja-owocne-ale-bez-przelomu.html', 'Rozmowy o Grecji owocne, ale bez przełomu', 'Szef eurogrupy Jeroen Dijsselbloem poinformował po spotkaniu przedstawicieli eurolandu, Międzynarodowego Funduszu Walutowego, Komisji Europejskiej oraz ministra finansów Grecji, że nastąpił postęp w rozmowach na temat reform, jakie mają podjąć Ateny.', '2017-02-10 20:43:00+01', 14, '2017-02-11 09:59:54.368+01', '2017-02-11 09:59:54.368+01', NULL);
INSERT INTO rss_entries (id, link, title, lead_content, pub_date, rssfeed_id, created_date, feed_date, category_id) VALUES (753, 'http://www.polskatimes.pl/fakty/kraj/a/jak-doszlo-do-wypadku-kolumny-rzadowej-oficjalnie,11782917/', 'Jak doszło do wypadku kolumny rządowej?', 'W piątkowy wieczór samochód, którym jechała premier Beata Szydło, brał udział w wypadku. Policja podała jego wstępną przyczynę.', '2017-02-10 21:17:00+01', 9, '2017-02-10 22:01:21.924+01', '2017-02-10 22:01:21.924+01', 1);
